import React, { Component } from 'react';
import './style.css';



export default class Footer extends Component {
  render() {
    return (
      <div>
        <h1>hello from Footer</h1>
        <Link to='/about' className="btn-primary">
                 github icon
                 </Link>
                 <Link to='/about' className="btn-primary">
                 codepen icon
                 </Link>
                 <Link to='/about' className="btn-primary">
                   Freecodecamp icon
                 </Link>
      </div>
    )
  }
}
